import axios from 'axios';
import React, { useEffect, useState } from 'react';
import '../styles/FlightBookings.css';

const FlightBookings = () => {
  const [userDetails, setUserDetails] = useState(null);
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    fetchUserData();
    fetchBookings();
  }, []);

  const fetchUserData = async () => {
    try {
      const id = localStorage.getItem('userId');
      const response = await axios.get(`http://localhost:6001/fetch-user/${id}`);
      setUserDetails(response.data);
    } catch (err) {
      console.error('Error fetching user data:', err);
    }
  };

  const fetchBookings = async () => {
    try {
      const response = await axios.get('http://localhost:6001/fetch-bookings');
      setBookings(response.data.reverse());
    } catch (err) {
      console.error('Error fetching bookings:', err);
    }
  };

  const cancelTicket = async (id) => {
    try {
      await axios.put(`http://localhost:6001/cancel-ticket/${id}`);
      alert('Ticket cancelled!');
      fetchBookings();
    } catch (err) {
      console.error('Error cancelling ticket:', err);
    }
  };

  const username = localStorage.getItem('username');

  return (
    <div className="user-bookingsPage">
      {userDetails ? (
        userDetails.approval === 'not-approved' ? (
          <div className="notApproved-box">
            <h3>Approval Required!</h3>
            <p>Your application is under processing and requires admin approval. Please be patient.</p>
          </div>
        ) : (
          <>
            <h1 className="text-center">Your Bookings</h1>
            <div className="user-bookings">
              {bookings.filter(b => b.flightName === username).length === 0 ? (
                <p style={{ textAlign: 'center', color: 'gray' }}>No bookings found.</p>
              ) : (
                bookings
                  .filter(b => b.flightName === username)
                  .map((booking) => (
                    <div className="user-booking" key={booking._id}>
                      <p><strong>Booking ID:</strong> {booking._id}</p>
                      <div className="booking-section">
                        <p><strong>Mobile:</strong> {booking.mobile}</p>
                        <p><strong>Email:</strong> {booking.email}</p>
                      </div>
                      <div className="booking-section">
                        <p><strong>Flight ID:</strong> {booking.flightId}</p>
                        <p><strong>Flight Name:</strong> {booking.flightName}</p>
                      </div>
                      <div className="booking-section">
                        <p><strong>From:</strong> {booking.departure}</p>
                        <p><strong>To:</strong> {booking.destination}</p>
                      </div>
                      <div className="booking-section">
                        <p><strong>Passengers:</strong></p>
                        <ul>
                          {booking.passengers.map((p, i) => (
                            <li key={i}>Name: {p.name}, Age: {p.age}</li>
                          ))}
                        </ul>
                      </div>
                      {booking.bookingStatus === 'confirmed' && (
                        <p><strong>Seats:</strong> {booking.seats}</p>
                      )}
                      <div className="booking-section">
                        <p><strong>Booking Date:</strong> {booking.bookingDate.slice(0, 10)}</p>
                        <p><strong>Journey Date:</strong> {booking.journeyDate.slice(0, 10)}</p>
                      </div>
                      <div className="booking-section">
                        <p><strong>Journey Time:</strong> {booking.journeyTime}</p>
                        <p><strong>Total Price:</strong> â‚¹{booking.totalPrice}</p>
                      </div>
                      <p style={{ color: booking.bookingStatus === 'cancelled' ? 'red' : 'green' }}>
                        <strong>Status:</strong> {booking.bookingStatus}
                      </p>
                      {booking.bookingStatus === 'confirmed' && (
                        <button className="btn btn-danger mt-2" onClick={() => cancelTicket(booking._id)}>
                          Cancel Ticket
                        </button>
                      )}
                    </div>
                  ))
              )}
            </div>
          </>
        )
      ) : (
        <p style={{ textAlign: 'center' }}>Loading user data...</p>
      )}
    </div>
  );
};

export default FlightBookings;
